import { pageLinks } from "../constants";
import { Link } from 'react-router-dom';

const Hero = () => {
  return (
    <div id="home" className="text-slate-100 font-semibold text-6xl">
      <div className="absolute right-10 top-10 flex flex-col justify-center h-screen">
        <ul className="text-right uppercase hover:cursor-pointer">
          {pageLinks.map((link) => (
            <li key={link.label} className="mb-10">
              {/* <a href={link.href} className="hover:opacity-30 hover:text-8xl" target="_blank">
                {link.label}
              </a> */}
              <Link to={link.href} className="hover:opacity-30 hover:text-8xl" target="_blank">
                {link.label}
              </Link>
            </li>
          ))} 
        </ul>
      </div>
    </div>
  );
};

export default Hero;
